INSERT INTO feature VALUES ('ADM1', 'A', 'first-order administrative division', 'a primary administrative division of a country, such as a state in the United States');
INSERT INTO feature VALUES ('ADM1H', 'A', 'historical first-order administrative division', 'a former first-order administrative division');
INSERT INTO feature VALUES ('ADM2', 'A', 'second-order administrative division', 'a subdivision of a first-order administrative division');
INSERT INTO feature VALUES ('ADM2H', 'A', 'historical second-order administrative division', 'a former second-order administrative division');
INSERT INTO feature VALUES ('ADM3', 'A', 'third-order administrative division', 'a subdivision of a second-order administrative division');
INSERT INTO feature VALUES ('ADM3H', 'A', 'historical third-order administrative division', 'a former third-order administrative division');
INSERT INTO feature VALUES ('ADM4', 'A', 'fourth-order administrative division', 'a subdivision of a third-order administrative division');
INSERT INTO feature VALUES ('ADM4H', 'A', 'historical fourth-order administrative division', 'a former fourth-order administrative division');
INSERT INTO feature VALUES ('ADM5', 'A', 'fifth-order administrative division', 'a subdivision of a fourth-order administrative division');
INSERT INTO feature VALUES ('ADM5H', 'A', 'historical fifth-order administrative division', 'a former fifth-order administrative division');
INSERT INTO feature VALUES ('ADMD', 'A', 'administrative division', 'an administrative division of a country, undifferentiated as to administrative level');
INSERT INTO feature VALUES ('ADMDH', 'A', 'historical administrative division ', 'a former administrative division of a political entity, undifferentiated as to administrative level');
INSERT INTO feature VALUES ('LTER', 'A', 'leased area', 'a tract of land leased to another country, usually for military installations');
INSERT INTO feature VALUES ('PCL', 'A', 'political entity', NULL);
INSERT INTO feature VALUES ('PCLD', 'A', 'dependent political entity', NULL);
INSERT INTO feature VALUES ('PCLF', 'A', 'freely associated state', NULL);
INSERT INTO feature VALUES ('PCLH', 'A', 'historical political entity', 'a former political entity');
INSERT INTO feature VALUES ('PCLI', 'A', 'independent political entity', NULL);
INSERT INTO feature VALUES ('PCLIX', 'A', 'section of independent political entity', NULL);
INSERT INTO feature VALUES ('PCLS', 'A', 'semi-independent political entity', NULL);
INSERT INTO feature VALUES ('PRSH', 'A', 'parish', 'an ecclesiastical district');
INSERT INTO feature VALUES ('TERR', 'A', 'territory', NULL);
INSERT INTO feature VALUES ('ZN', 'A', 'zone', NULL);
INSERT INTO feature VALUES ('ZNB', 'A', 'buffer zone', 'a zone recognized as a buffer between two nations in which military presence is minimal or absent');
INSERT INTO feature VALUES ('AIRS', 'H', 'seaplane landing area', 'a place on a waterbody where floatplanes land and take off');
INSERT INTO feature VALUES ('ANCH', 'H', 'anchorage', 'an area where vessels may anchor');
INSERT INTO feature VALUES ('BAY', 'H', 'bay', 'a coastal indentation between two capes or headlands, larger than a cove but smaller than a gulf');
INSERT INTO feature VALUES ('BAYS', 'H', 'bays', 'coastal indentations between two capes or headlands, larger than a cove but smaller than a gulf');
INSERT INTO feature VALUES ('BGHT', 'H', 'bight(s)', 'an open body of water forming a slight recession in a coastline');
INSERT INTO feature VALUES ('BNK', 'H', 'bank(s)', 'an elevation, typically located on a shelf, over which the depth of water is relatively shallow but sufficient for most surface navigation');
INSERT INTO feature VALUES ('BNKR', 'H', 'stream bank', 'a sloping margin of a stream channel which normally confines the stream to its channel on land');
INSERT INTO feature VALUES ('BNKX', 'H', 'section of bank', NULL);
INSERT INTO feature VALUES ('BOG', 'H', 'bog(s)', 'a wetland characterized by peat forming sphagnum moss, sedge, and other acid-water plants');
INSERT INTO feature VALUES ('CAPG', 'H', 'icecap', 'a dome-shaped mass of glacial ice covering an area of mountain summits or other high lands; smaller than an ice sheet');
INSERT INTO feature VALUES ('CHN', 'H', 'channel', 'the deepest part of a stream, bay, lagoon, or strait, through which the main current flows');
INSERT INTO feature VALUES ('CHNL', 'H', 'lake channel(s)', 'that part of a lake having water deep enough for navigation between islands, shoals, etc.');
INSERT INTO feature VALUES ('CHNM', 'H', 'marine channel', 'that part of a body of water deep enough for navigation through an area otherwise not suitable');
INSERT INTO feature VALUES ('CHNN', 'H', 'navigation channel', 'a buoyed channel of sufficient depth for the safe navigation of vessels');
INSERT INTO feature VALUES ('CNFL', 'H', 'confluence', 'a place where two or more streams or intermittent streams flow together');
INSERT INTO feature VALUES ('CNL', 'H', 'canal', 'an artificial watercourse');
INSERT INTO feature VALUES ('CNLA', 'H', 'aqueduct', 'a conduit used to carry water');
INSERT INTO feature VALUES ('CNLB', 'H', 'canal bend', 'a conspicuously curved or bent section of a canal');
INSERT INTO feature VALUES ('CNLD', 'H', 'drainage canal', 'an artificial waterway carrying water away from a wetland or from drainage ditches');
INSERT INTO feature VALUES ('CNLI', 'H', 'irrigation canal', 'a canal which serves as a main conduit for irrigation water');
INSERT INTO feature VALUES ('CNLN', 'H', 'navigation canal(s)', 'a watercourse constructed for navigation of vessels');
INSERT INTO feature VALUES ('CNLQ', 'H', 'abandoned canal', NULL);
INSERT INTO feature VALUES ('CNLSB', 'H', 'underground irrigation canal(s)', 'a gently inclined underground tunnel bringing water for irrigation from aquifers');
INSERT INTO feature VALUES ('CNLX', 'H', 'section of canal', NULL);
INSERT INTO feature VALUES ('COVE', 'H', 'cove(s)', 'a small coastal indentation, smaller than a bay');
INSERT INTO feature VALUES ('CRKT', 'H', 'tidal creek(s)', 'a meandering channel in a coastal wetland subject to bi-directional tidal currents');
INSERT INTO feature VALUES ('CRNT', 'H', 'current', 'a horizontal flow of water in a given direction with uniform velocity');
INSERT INTO feature VALUES ('CUTF', 'H', 'cutoff', 'a channel formed as a result of a stream cutting through a meander neck');
INSERT INTO feature VALUES ('DCK', 'H', 'dock(s)', 'a waterway between two piers, or cut into the land for the berthing of ships');
INSERT INTO feature VALUES ('DCKB', 'H', 'docking basin', 'a part of a harbor where ships dock');
INSERT INTO feature VALUES ('DOMG', 'H', 'icecap dome', 'a comparatively elevated area on an icecap');
