INSERT INTO feature VALUES ('LEV', 'T', 'levee', 'a natural low embankment bordering a distributary or meandering stream; often built up artificially to control floods');
INSERT INTO feature VALUES ('MESA', 'T', 'mesa(s)', 'a flat-topped, isolated elevation with steep slopes on all sides, less extensive than a plateau');
INSERT INTO feature VALUES ('MND', 'T', 'mound(s)', 'a low, isolated, rounded hill');
INSERT INTO feature VALUES ('MRN', 'T', 'moraine', 'a mound, ridge, or other accumulation of glacial till');
INSERT INTO feature VALUES ('MT', 'T', 'mountain', 'an elevation standing high above the surrounding area with small summit area, steep slopes and local relief of 300m or more');
INSERT INTO feature VALUES ('MTS', 'T', 'mountains', 'a mountain range or a group of mountains or high ridges');
INSERT INTO feature VALUES ('NKM', 'T', 'meander neck', 'a narrow strip of land between the two limbs of a meander loop at its narrowest point');
INSERT INTO feature VALUES ('PAN', 'T', 'pan', 'a near-level shallow, natural depression or basin, usually containing an intermittent lake, pond, or pool');
INSERT INTO feature VALUES ('PANS', 'T', 'pans', 'a near-level shallow, natural depression or basin, usually containing an intermittent lake, pond, or pool');
INSERT INTO feature VALUES ('PASS', 'T', 'pass', 'a break in a mountain range or other high obstruction, used for transportation from one side to the other [See also gap]');
INSERT INTO feature VALUES ('PEN', 'T', 'peninsula', 'an elongate area of land projecting into a body of water and nearly surrounded by water');
INSERT INTO feature VALUES ('PENX', 'T', 'section of peninsula', NULL);
INSERT INTO feature VALUES ('PK', 'T', 'peak', 'a pointed elevation atop a mountain, ridge, or other hypsographic feature');
INSERT INTO feature VALUES ('PKS', 'T', 'peaks', 'pointed elevations atop a mountain, ridge, or other hypsographic features');
INSERT INTO feature VALUES ('PLAT', 'T', 'plateau', 'an elevated plain with steep slopes on one or more sides, and often with incised streams');
INSERT INTO feature VALUES ('PLATX', 'T', 'section of plateau', NULL);
INSERT INTO feature VALUES ('PLDR', 'T', 'polder', 'an area reclaimed from the sea by diking and draining');
INSERT INTO feature VALUES ('PLN', 'T', 'plain(s)', 'an extensive area of comparatively level to gently undulating land, lacking surface irregularities, and usually adjacent to a higher area');
INSERT INTO feature VALUES ('PLNX', 'T', 'section of plain', NULL);
INSERT INTO feature VALUES ('PROM', 'T', 'promontory(-ies)', 'a bluff or prominent hill overlooking or projecting into a lowland');
INSERT INTO feature VALUES ('PT', 'T', 'point', 'a tapering piece of land projecting into a body of water, less prominent than a cape');
INSERT INTO feature VALUES ('PTS', 'T', 'points', 'tapering pieces of land projecting into a body of water, less prominent than a cape');
INSERT INTO feature VALUES ('RDGB', 'T', 'beach ridge', 'a ridge of sand just inland and parallel to the beach, usually in series');
INSERT INTO feature VALUES ('RDGE', 'T', 'ridge(s)', 'a long narrow elevation with steep sides, and a more or less continuous crest');
INSERT INTO feature VALUES ('REG', 'T', 'stony desert', 'a desert plain characterized by a surface veneer of gravel and stones');
INSERT INTO feature VALUES ('RK', 'T', 'rock', 'a conspicuous, isolated rocky mass');
INSERT INTO feature VALUES ('RKFL', 'T', 'rockfall', 'an irregular mass of fallen rock at the base of a cliff or steep slope');
INSERT INTO feature VALUES ('RKS', 'T', 'rocks', 'conspicuous, isolated rocky masses');
INSERT INTO feature VALUES ('SAND', 'T', 'sand area', 'a tract of land covered with sand');
INSERT INTO feature VALUES ('SBED', 'T', 'dry stream bed', 'a channel formerly containing the water of a stream');
INSERT INTO feature VALUES ('SCRP', 'T', 'escarpment', 'a long line of cliffs or steep slopes separating level surfaces above and below');
INSERT INTO feature VALUES ('SDL', 'T', 'saddle', 'a broad, open pass crossing a ridge or between hills or mountains');
INSERT INTO feature VALUES ('SHOR', 'T', 'shore', 'a narrow zone bordering a waterbody which covers and uncovers at high and low water, respectively');
INSERT INTO feature VALUES ('SINK', 'T', 'sinkhole', 'a small crater-shape depression in a karst area');
INSERT INTO feature VALUES ('SLID', 'T', 'slide', 'a mound of earth material, at the base of a slope and the associated scoured area');
INSERT INTO feature VALUES ('SLP', 'T', 'slope(s)', 'a surface with a relatively uniform slope angle');
INSERT INTO feature VALUES ('SPIT', 'T', 'spit', 'a narrow, straight or curved continuation of a beach into a waterbody');
INSERT INTO feature VALUES ('SPUR', 'T', 'spur(s)', 'a subordinate ridge projecting outward from a hill, mountain or other elevation');
INSERT INTO feature VALUES ('TAL', 'T', 'talus slope', 'a steep concave slope formed by an accumulation of loose rock fragments at the base of a cliff or steep slope');
INSERT INTO feature VALUES ('TRGD', 'T', 'interdune trough(s)', 'a long wind-swept trough between parallel longitudinal dunes');
INSERT INTO feature VALUES ('TRR', 'T', 'terrace', 'a long, narrow alluvial platform bounded by steeper slopes above and below, usually overlooking a waterbody');
INSERT INTO feature VALUES ('UPLD', 'T', 'upland', 'an extensive interior region of high land with low to moderate surface relief');
INSERT INTO feature VALUES ('VAL', 'T', 'valley', 'an elongated depression usually traversed by a stream');
INSERT INTO feature VALUES ('VALG', 'T', 'hanging valley', 'a valley the floor of which is notably higher than the valley or shore to which it leads; most common in areas that have been glaciated');
INSERT INTO feature VALUES ('VALS', 'T', 'valleys', 'elongated depressions usually traversed by a stream');
INSERT INTO feature VALUES ('VALX', 'T', 'section of valley', NULL);
INSERT INTO feature VALUES ('VLC', 'T', 'volcano', 'a conical elevation composed of volcanic materials with a crater at the top');
INSERT INTO feature VALUES ('APNU', 'U', 'apron', 'a gentle slope, with a generally smooth surface, particularly found around groups of islands and seamounts');
INSERT INTO feature VALUES ('ARCU', 'U', 'arch', 'a low bulge around the southeastern end of the island of Hawaii');
INSERT INTO feature VALUES ('ARRU', 'U', 'arrugado', 'an area of subdued corrugations off Baja California');
INSERT INTO feature VALUES ('BDLU', 'U', 'borderland', 'a region adjacent to a continent, normally occupied by or bordering a shelf, that is highly irregular with depths well in excess of those typical of a shelf');
INSERT INTO feature VALUES ('BKSU', 'U', 'banks', 'elevations, typically located on a shelf, over which the depth of water is relatively shallow but sufficient for safe surface navigation');
INSERT INTO feature VALUES ('BNKU', 'U', 'bank', 'an elevation, typically located on a shelf, over which the depth of water is relatively shallow but sufficient for safe surface navigation');
INSERT INTO feature VALUES ('BSNU', 'U', 'basin', 'a depression more or less equidimensional in plan and of variable extent');
INSERT INTO feature VALUES ('CDAU', 'U', 'cordillera', 'an entire mountain system including the subordinate ranges, interior plateaus, and basins');
INSERT INTO feature VALUES ('CNSU', 'U', 'canyons', 'relatively narrow, deep depressions with steep sides, the bottom of which generally has a continuous slope');
INSERT INTO feature VALUES ('CNYU', 'U', 'canyon', 'a relatively narrow, deep depression with steep sides, the bottom of which generally has a continuous slope');
INSERT INTO feature VALUES ('CRSU', 'U', 'continental rise', 'a gentle slope rising from oceanic depths towards the foot of a continental slope');
INSERT INTO feature VALUES ('DEPU', 'U', 'deep', 'a localized deep area within the confines of a larger feature, such as a trough, basin or trench');
INSERT INTO feature VALUES ('EDGU', 'U', 'shelf edge', 'a line along which there is a marked increase of slope at the outer margin of a continental shelf or island shelf');
INSERT INTO feature VALUES ('ESCU', 'U', 'escarpment (or scarp)', 'an elongated and comparatively steep slope separating flat or gently sloping areas');
INSERT INTO feature VALUES ('FANU', 'U', 'fan', 'a relatively smooth feature normally sloping away from the lower termination of a canyon or canyon system');
INSERT INTO feature VALUES ('FLTU', 'U', 'flat', 'a small level or nearly level area');
INSERT INTO feature VALUES ('FRZU', 'U', 'fracture zone', 'an extensive linear zone of irregular topography of the sea floor, characterized by steep-sided or asymmetrical ridges, troughs, or escarpments');
INSERT INTO feature VALUES ('FURU', 'U', 'furrow', 'a closed, linear, narrow, shallow depression');
INSERT INTO feature VALUES ('GAPU', 'U', 'gap', 'a narrow break in a ridge or rise');
INSERT INTO feature VALUES ('GLYU', 'U', 'gully', 'a small valley-like feature');
INSERT INTO feature VALUES ('HLLU', 'U', 'hill', 'an elevation rising generally less than 500 meters');
INSERT INTO feature VALUES ('HLSU', 'U', 'hills', 'elevations rising generally less than 500 meters');
INSERT INTO feature VALUES ('HOLU', 'U', 'hole', 'a small depression of the sea floor');
INSERT INTO feature VALUES ('KNLU', 'U', 'knoll', 'an elevation rising generally more than 500 meters and less than 1,000 meters and of limited extent across the summit');
INSERT INTO feature VALUES ('KNSU', 'U', 'knolls', 'elevations rising generally more than 500 meters and less than 1,000 meters and of limited extent across the summits');
INSERT INTO feature VALUES ('LDGU', 'U', 'ledge', 'a rocky projection or outcrop, commonly linear and near shore');
INSERT INTO feature VALUES ('MESU', 'U', 'mesa', 'an isolated, extensive, flat-topped elevation on the shelf, with relatively steep sides');
INSERT INTO feature VALUES ('MNDU', 'U', 'mound', 'a low, isolated, rounded hill');
INSERT INTO feature VALUES ('MOTU', 'U', 'moat', 'an annular depression that may not be continuous, located at the base of many seamounts, islands, and other isolated elevations');
INSERT INTO feature VALUES ('MTU', 'U', 'mountain', 'a well-delineated subdivision of a large and complex positive feature');
INSERT INTO feature VALUES ('PKSU', 'U', 'peaks', 'prominent elevations, part of a larger feature, either pointed or of very limited extent across the summit');
INSERT INTO feature VALUES ('PKU', 'U', 'peak', 'a prominent elevation, part of a larger feature, either pointed or of very limited extent across the summit');
INSERT INTO feature VALUES ('PLNU', 'U', 'plain', 'a flat, gently sloping or nearly level region');
INSERT INTO feature VALUES ('PLTU', 'U', 'plateau', 'a comparatively flat-topped feature of considerable extent, dropping off abruptly on one or more sides');
INSERT INTO feature VALUES ('PNLU', 'U', 'pinnacle', 'a high tower or spire-shaped pillar of rock or coral, alone or cresting a summit');
INSERT INTO feature VALUES ('PRVU', 'U', 'province', 'a region identifiable by a group of similar physiographic features whose characteristics are markedly in contrast with surrounding areas');
INSERT INTO feature VALUES ('RDGU', 'U', 'ridge', 'a long narrow elevation with steep sides');
INSERT INTO feature VALUES ('RDSU', 'U', 'ridges', 'long narrow elevations with steep sides');
INSERT INTO feature VALUES ('RFSU', 'U', 'reefs', 'surface-navigation hazards composed of consolidated material');
INSERT INTO feature VALUES ('RFU', 'U', 'reef', 'a surface-navigation hazard composed of consolidated material');
INSERT INTO feature VALUES ('RISU', 'U', 'rise', 'a broad elevation that rises gently, and generally smoothly, from the sea floor');
INSERT INTO feature VALUES ('SCNU', 'U', 'seachannel', 'a continuously sloping, elongated depression commonly found in fans or plains and customarily bordered by levees on one or two sides');
INSERT INTO feature VALUES ('SCSU', 'U', 'seachannels', 'continuously sloping, elongated depressions commonly found in fans or plains and customarily bordered by levees on one or two sides');
INSERT INTO feature VALUES ('SDLU', 'U', 'saddle', 'a low part, resembling in shape a saddle, in a ridge or between contiguous seamounts');
INSERT INTO feature VALUES ('SHFU', 'U', 'shelf', 'a zone adjacent to a continent (or around an island) that extends from the low water line to a depth at which there is usually a marked increase of slope towards oceanic depths');
INSERT INTO feature VALUES ('SHLU', 'U', 'shoal', 'a surface-navigation hazard composed of unconsolidated material');
INSERT INTO feature VALUES ('SHSU', 'U', 'shoals', 'hazards to surface navigation composed of unconsolidated material');
INSERT INTO feature VALUES ('SHVU', 'U', 'shelf valley', 'a valley on the shelf, generally the shoreward extension of a canyon');
INSERT INTO feature VALUES ('SILU', 'U', 'sill', 'the low part of a gap or saddle separating basins');
INSERT INTO feature VALUES ('SLPU', 'U', 'slope', 'the slope seaward from the shelf edge to the beginning of a continental rise or the point where there is a general reduction in slope');
INSERT INTO feature VALUES ('SMSU', 'U', 'seamounts', 'elevations rising generally more than 1,000 meters and of limited extent across the summit');
INSERT INTO feature VALUES ('SMU', 'U', 'seamount', 'an elevation rising generally more than 1,000 meters and of limited extent across the summit');
INSERT INTO feature VALUES ('SPRU', 'U', 'spur', 'a subordinate elevation, ridge, or rise projecting outward from a larger feature');
INSERT INTO feature VALUES ('TERU', 'U', 'terrace', 'a relatively flat horizontal or gently inclined surface, sometimes long and narrow, which is bounded by a steeper ascending slope on one side and by a steep descending slope on the opposite side');
INSERT INTO feature VALUES ('TMSU', 'U', 'tablemounts (or guyots)', 'seamounts having a comparatively smooth, flat top');
INSERT INTO feature VALUES ('TMTU', 'U', 'tablemount (or guyot)', 'a seamount having a comparatively smooth, flat top');
INSERT INTO feature VALUES ('TNGU', 'U', 'tongue', 'an elongate (tongue-like) extension of a flat sea floor into an adjacent higher feature');
INSERT INTO feature VALUES ('TRGU', 'U', 'trough', 'a long depression of the sea floor characteristically flat bottomed and steep sided, and normally shallower than a trench');
INSERT INTO feature VALUES ('TRNU', 'U', 'trench', 'a long, narrow, characteristically very deep and asymmetrical depression of the sea floor, with relatively steep sides');
INSERT INTO feature VALUES ('VALU', 'U', 'valley', 'a relatively shallow, wide depression, the bottom of which usually has a continuous gradient');
INSERT INTO feature VALUES ('VLSU', 'U', 'valleys', 'a relatively shallow, wide depression, the bottom of which usually has a continuous gradient');
INSERT INTO feature VALUES ('BUSH', 'V', 'bush(es)', 'a small clump of conspicuous bushes in an otherwise bare area');
INSERT INTO feature VALUES ('CULT', 'V', 'cultivated area', 'an area under cultivation');
INSERT INTO feature VALUES ('FRST', 'V', 'forest(s)', 'an area dominated by tree vegetation');
INSERT INTO feature VALUES ('FRSTF', 'V', 'fossilized forest', 'a forest fossilized by geologic processes and now exposed at the earth''s surface');
INSERT INTO feature VALUES ('GROVE', 'V', 'grove', 'a small wooded area or collection of trees growing closely together, occurring naturally or deliberately planted');
INSERT INTO feature VALUES ('GRSLD', 'V', 'grassland', 'an area dominated by grass vegetation');
INSERT INTO feature VALUES ('GRVC', 'V', 'coconut grove', 'a planting of coconut trees');
INSERT INTO feature VALUES ('GRVO', 'V', 'olive grove', 'a planting of olive trees');
INSERT INTO feature VALUES ('GRVP', 'V', 'palm grove', 'a planting of palm trees');
INSERT INTO feature VALUES ('GRVPN', 'V', 'pine grove', 'a planting of pine trees');
INSERT INTO feature VALUES ('HTH', 'V', 'heath', 'an upland moor or sandy area dominated by low shrubby vegetation including heather');
INSERT INTO feature VALUES ('MDW', 'V', 'meadow', 'a small, poorly drained area dominated by grassy vegetation');
INSERT INTO feature VALUES ('OCH', 'V', 'orchard(s)', 'a planting of fruit or nut trees');
INSERT INTO feature VALUES ('SCRB', 'V', 'scrubland', 'an area of low trees, bushes, and shrubs stunted by some environmental limitation');
INSERT INTO feature VALUES ('TREE', 'V', 'tree(s)', 'a conspicuous tree used as a landmark');
INSERT INTO feature VALUES ('TUND', 'V', 'tundra', 'a marshy, treeless, high latitude plain, dominated by mosses, lichens, and low shrub vegetation under permafrost conditions');
INSERT INTO feature VALUES ('VIN', 'V', 'vineyard', 'a planting of grapevines');
INSERT INTO feature VALUES ('VINS', 'V', 'vineyards', 'plantings of grapevines');
